import React from "react";

import './UserList.css';

const UserList = (props) =>{
    return (
        <div className="user-list">
            {props.userData.map( usr => {return (
                <div key={usr.id} className="user-data">
                    {usr.name} ({usr.age} years old)
                </div> 
            )})}
        </div>
    )
}

export default UserList;
